  false,\n\t\"url\": null,\n\t\"notes\": \"LinkUp only indexes jobs that are found
  on corporate career websites. Today, our U.S site lists roughly 1,500,000 jobs from
  over 40,000 company websites. Since we don't allow jobs to be manually posted to
  LinkUp, and because of the sources we index (real companies), we have the cleanest
  and highest quality dataset of jobs on the web - no job scams, lead-gen pollution,
  or fraudulent postings. For questions or comments, contact: bsquibb@linkup.com\",\n\t\"license_title\":
